window.bookSummaryJSON = "<p>An inexperienced officer. A dysfunctional ship. Life in the Deep Dark just got a whole lot harder. </p> <p>In his first assignment as an officer, Ishmael Horatio Wang finds himself fresh out of school, wet behind the ears, and way out of his depth. Aboard the <i>William Tinker</i> the senior officers are derelict and abusive, the crew demoralized and undisciplined, and change unwelcomed and dangerous. Can Ishmael use what he learned aboard the <i>Lois McKendrick</i> to help the crew find the ship's heart? Or will he discover that bucking the system may come at too high a price? Return to the Deep Dark with Ish in this fourth installment of the award-winning Solar Clipper series, as he makes the transition from crew to officer. </p>"; 
